import './App.css';
import Navbar from './components/Navbar';
import Home from './pages';
import { GlobalProvider } from './context/GlobalState';
import { Header } from './components/Tracker/Header';
import { Balance } from './components/Tracker/Balance';
import { IncomeExpenses } from './components/Tracker/TransactionList';
import { AddTransaction } from './components/Tracker/AddTransaction';
import { TransactionList } from './components/Tracker/TransactionList';



function App() {
  return (

     <Home>
     <GlobalProvider>
        <Header />
        <Balance></Balance>
        <IncomeExpenses></IncomeExpenses>
        <TransactionList></TransactionList>
        <AddTransaction></AddTransaction>
      </GlobalProvider>   
     </Home> 
  );
}

export default App;
